import React from 'react';
import { NavLink } from 'react-router-dom';
import './style.css';

class Logo extends React.Component {

    render() {
        return (
            <div className="logo-title">

            <NavLink to='/'>
                    Johnny Li
            </NavLink>
            </div>

        );
    }
}

export default Logo;
